package leetcode

import "testing"

func Test_findTheDifference(t *testing.T) {
	type args struct {
		s string
		t string
	}
	tests := []struct {
		name string
		args args
		want byte
	}{
		{
			"[Test Case 1]",
			args{
				"",
				"",
			},
			't',
		},
		{
			"[Test Case 2]",
			args{
				"abcd",
				"abcde",
			},
			'e',
		},
		{
			"[Test Case 3]",
			args{
				"abcd",
				"adebc",
			},
			'e',
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := findTheDifference(tt.args.s, tt.args.t); got != tt.want {
				t.Errorf("findTheDifference() = %v, want %v", got, tt.want)
			}
		})
	}
}
